webpackJsonp([88902560777581],{490:function(e,t){e.exports={data:{markdownRemark:{html:"<h3>Hacker Skills</h3>\n<p>The new Hacker Skills feature enables hackers to identify their skill set which enables them to qualify for invitations specific to their skill sets. Each skill a hacker puts will be verified by HackerOne. </p>\n<h3>Configure SLAs for Triage and Resolution</h3>\n<p>We enable programs to set internal Service Level Agreements (SLAs) by configuring the amount of time that can elapse before a report is marked for their program. </p>\n<h3>Change Report State via API</h3>\n<p>We enable you to change the state of a report through utilizing our API. </p>\n<h3>Export as .zip</h3>\n<p>We provide a new export option where you can download the contents of the report and all attachments in a single zip archive. </p>",frontmatter:{path:"/changelog/2016/november",title:"November 2016"}}},pathContext:{}}}});
